module.exports = JSON.parse('{"archive":{"blogPosts":[{"id":"2026-01-02-changelog","metadata":{"permalink":"/docs/changelog/2026-01-02-changelog","source":"@site/changelog/2026-01-02-changelog.md","title":"2026년 1월","description":"Suprema Docs를 처음 배포한 후 지난 12월까지의 업데이트 내역을 제공합니다.","date":"2026-01-02T00:00:00.000Z","tags":[],"readingTime":1.57,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"2026년 1월","description":"Suprema Docs를 처음 배포한 후 지난 12월까지의 업데이트 내역을 제공합니다.","slug":"2026-01-02-changelog","isTranslationMissing":false},"unlisted":false},"content":"**Suprema Docs**를 처음 배포한 후 지난 12월까지의 플랫폼별, 장치별 문서 업데이트 내역을 제공합니다.\\n\\n![Suprema Docs](/img/changelogs-202501.png)\\n\\n<!-- truncate -->\\n\\n## BioStar X\\n\\n* [BioStar X v1.0.1 릴리스 노트](../platform/biostar_x/release-notes/101)를 배포했습니다.\\n\\n* [IR 페이스](../platform/biostar_x/enroll-credential-ir-face) 크리덴셜 추가에 따른 문서를 추가했습니다.\\n\\n* [리모트 액세스](../platform/biostar_x/settings-remote-access) 설정 및 사용 안내 문서를 추가했습니다.\\n\\n* [가상 장치](../platform/biostar_x/settings-virtual-device-event-log) 기능을 사용해 이벤트 로그를 연동할 수 있습니다.\\n\\n* 사용자 및 데이터, 감사 추적 관련 메뉴에서 CSV 또는 PDF 내보내기 시 내보내기 사유를 기입해야 함을 안내하는 내용을 추가했습니다.\\n\\n  * [사용자 정보 내보내기/가져오기](../platform/biostar_x/export-import-user-info)\\n\\n  * [리포트 생성하기](../platform/biostar_x/data-generate-reports)\\n\\n  * [감사 추적 관리하기](../platform/biostar_x/settings-system-audit-trail)\\n\\n* [라이선스 정책](../platform/biostar_x/licensing)의 세부 내역을 변경했습니다.\\n\\n  * Base License 없을 때 장치 추가 불가 안내\\n\\n  * 이더넷 연결 장치 대수 제한 추가\\n\\n  * 최대 관리자 수 설명 추가\\n\\n* [BioStar X API](../api/bsxapi) 문서를 추가했습니다.\\n\\n* 복잡한 라이선스 요구 사항을 해결하는 데 도움이 되는 [BioStar X 라이선스 계산기](../bsx-license-calculator) 페이지를 추가했습니다.\\n\\n## Devices\\n\\n최신의 장치 매뉴얼을 모두 업데이트했습니다. Suprema Docs에서 확인할 수 있는 장치 매뉴얼은 아래와 같습니다.\\n\\n### Biometric Devices\\n\\n* [BioEntry W3](../device/bioentry_w3/)\\n* [BioStation 2a](../device/biostation_2a)\\n* [BioStation 3](../device/biostation_3)\\n* [FaceStation F2](../device/facestation_f2)\\n* [FaceStation 2](../device/facestation_2)\\n* [BioLite N2](../device/biolite_n2)\\n* [BioEntry W2](../device/bioentry_w2)\\n* [BioEntry P2](../device/bioentry_p2)\\n* [BioEntry R2](../device/bioentry_r2)\\n\\n### RF/Mobile Devices\\n\\n* [X-Station 2](../device/xstation_2)\\n* [XPass 2](../device/xpass_2)\\n* [XPass D2](../device/xpass_d2)\\n* [XPass S2](../device/xpass_s2)\\n\\n### Intelligent Controller\\n\\n* [CoreStation 20](../device/corestation_20)\\n* [CoreStation](../device/corestation_40)\\n* [Enclosure](../device/enclosure)\\n\\n### Peripherals\\n\\n* [Door Interface](../device/doorinterface)\\n* [Input Module](../device/inputmodule)\\n* [Output Module](../device/outputmodule)\\n* [Door Module](../device/doormodule)\\n* [Secure Module](../device/securemodule)\\n* [Extended Module](../device/extendedmodule)\\n* [Extended Module-SC](../device/extendedmodule_sc)\\n\\n### APPS\\n\\n* [Device Manager](../device/device_manager)\\n* [CoreStation Setup Manager](../device/corestation_setup_manager)\\n\\n## 향후 계획\\n\\n다국어 지원을 확대할 예정입니다. 곧 일본어, 스페인어 문서를 확인할 수 있습니다."}]}}')

